description: >
  Every third Saturday of each month, North Shore Latin Dance is bringing the
  sizzle to Westgate with a special night of Latin dancing that's open to
  EVERYONE. No partners are required to join the class and the party.


  Join us for an unforgettable experience as we dance the night away to the pulsating beats of popular Latin songs! 


  This month is extra special because the incredible Kahu is back to teach Bachata open-level dance class at 7:30 pm. 

  The party doesn't stop there! North Shore Latin Dance DJ C (aka the HitMan) will be spinning the most favorable Salsa, Mambo, Bachata and other popular Latin tunes with adding some flavors of Kizomba songs. Don't miss out on the rhythm, the fun, and the vibrant energy. 



  *Saturday 3rd week of every months @7:30pm

  ￼

  *Miss Q’s Westgate

  ￼

  *Door Fee $10 cash only

  Bank transfer to 0313220810211000 (Y S Chi) with your full name as a reference.


  We look forward to having a wonderful night !￼
